import React, { Component } from 'react';
import Navbar from './Component/Navbar';
import './App.css';
import Counters from './Component/Counters';
class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Navbar>
          <main className="container">
            <Counters />
          </main>
        </Navbar>
      </React.Fragment >
    );
  }
}

export default App;
